// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity >=0.4.22 <0.9.0;

contract Auction {
/**owner: L'adresse du propritaire du smart contract.
start_time: La date et l'heure de dbut de l'enchre.
end_time: La date et l'heure de fin de l'enchre.
reserve_price: Le prix minimum auquel l'enchre doit tre vendue.
current_price: Le prix actuel de l'enchre.
bids:  dictionnaire qui mappe les adresses des participants aux enchres au montant de leurs enchres. 
*/
    address payable owner;
    uint256 start_time;
    uint256 end_time;
    uint256 reserve_price;
    uint256 current_price;
    mapping(address => uint256) bids;
    address payable winner;

    constructor(uint256 _start_time, uint256 _end_time, uint256 _reserve_price) {
        owner = payable(msg.sender);
        winner = owner;
        start_time = _start_time;
        end_time = _end_time;
        reserve_price = _reserve_price;
    }
/**
Une fonction qui permet aux participants d'enchrir sur l'actif.
 */

    function bid(uint256 amount) public payable {
        require(msg.sender != owner, "le payeur est le proprietaire");
        require(block.timestamp >= start_time && block.timestamp <= end_time, "hors delai");
        require(amount > current_price, "le montant est trop faible");

        bids[msg.sender] = amount;
        winner = payable(msg.sender);
        current_price = bids[msg.sender];
    }

/**fonction qui est appele  la fin de l'enchre et qui paie le prix gagnant au participant gagnant
 */
    function auctionEnd() public {
        require(block.timestamp >= end_time, "on a depasse le temps limite");

        if (current_price >= reserve_price) {
            winner.transfer(current_price);
        }
    }
}
